CREATE TABLE Events(
   id              VARCHAR(36) NOT NULL PRIMARY KEY
  ,name            VARCHAR(32) NOT NULL
  ,description     VARCHAR(219) NOT NULL
  ,date            VARCHAR(24) NOT NULL
  ,location        VARCHAR(26) NOT NULL
  ,locationAdress  VARCHAR(46) NOT NULL
  ,ticketPrice     INTEGER  NOT NULL
  ,maxTicketAmount INTEGER  NOT NULL
  ,ticketsSold     INTEGER  NOT NULL
  ,imageUrl        VARCHAR(65) NOT NULL
  ,createdAt       VARCHAR(24) NOT NULL
  ,updatedAt       VARCHAR(24) NOT NULL
);

CREATE TABLE Tickets(
   id             VARCHAR(36) NOT NULL PRIMARY KEY
  ,eventId        VARCHAR(36) NOT NULL
  ,status         VARCHAR(6) NOT NULL
  ,firstname      VARCHAR(9) NOT NULL
  ,lastname       VARCHAR(11) NOT NULL
  ,createdAt      VARCHAR(24) NOT NULL
  ,updatedAt      VARCHAR(24) NOT NULL
  ,ticketProduced VARCHAR(5) NOT NULL
);
